broadcast chan GO;
clock globalClock;
const int periodicThreads = 4;
const int schedulerID = 0;
const int exerciseBound = 12000;
bool synchronized = false;

const int totalThreads = periodicThreads;
typedef int[1,periodicThreads] PeriodicID;
typedef int[1,totalThreads] ThreadID;
int running[totalThreads+1];
//Scheduler
bool schedulable[ThreadID];
bool blocked[ThreadID];
chan run[ThreadID];
// bools for synchronization


void runScheduler(){
	int i;
	for (i = 0; i <= totalThreads; i++){
		running[i] = 0;
	}
	running[schedulerID] = 1;
}

int monitorDepth = 0;
void monitorEnter(){
	synchronized = true;
	monitorDepth++;
}

void monitorExit(){
	monitorDepth--;
	if (monitorDepth == 0){
		synchronized = false;
		for(i:ThreadID) {
			blocked[i] = false;
		}
		runScheduler();
	}
}

//

/*
* This is for the FPS-scheduler
*/
int selectedThreadPriority = -1;

void enqueue_task(ThreadID tid, const int pri) {
	if(pri < selectedThreadPriority) {
		return;
	} else if(pri >= selectedThreadPriority) {
		int i;
		if(synchronized){
		    blocked[tid] = true;
	    } else {
	    	for(i = 0; i <= totalThreads; i++){
		    	running[i] = 0;
	       	}
	        running[schedulerID] = 1;
		}
	}
}

void dequeue_task(ThreadID tid) {
	int i;
	if(synchronized){
		    blocked[tid] = true;
	} else {
		for(i = 0; i <= totalThreads; i++){
			running[i] = 0;
		}
		running[schedulerID] = 1;
	}
}
/*
* End of FPS-scheduler
*/


