/*
* The scheduler_wcet constant needs to be set according to the specific scheduler used
*/
const int scheduler_wcet = 1;
int selectedThread;
clock executionTime;

void select_thread(){
		int i;
		selectedThread = -1;
		selectedThreadPriority = -1;
		for(i:ThreadID){
			if(schedulable[i] && threadPriority[i] > selectedThreadPriority){
				selectedThread = i;
				selectedThreadPriority = threadPriority[i];
			}
		}

		for (i = 0; i <= totalThreads; i++){
			running[i] = 0;
		}
		running[selectedThread] = 1;
}

void idle(){
		int i;
		for (i = 0; i <= totalThreads; i++){
			running[i] = 0;
		}
		selectedThreadPriority = -1;
}

